import React from 'react';
import {BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";
import Views from './Components/Views'
import NavBar from './Components/Navigation'
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
      <div>
      <NavBar/>
      </div>
      <div className="Center-Container">
      <Switch>

        <Views/>
      </Switch>
      </div>
      </div>
    </Router>
  );
}

export default App;
